import "./page1.css"
import Footer from './Footer';
import Img from './Navbar';
import Main from './Main';
import Header from './Header';
import Header2 from './Header2';




export default function Page1() {
    return (
        <div>
            <div className="container">
                <div className="container1">
                    <Img />
                    <Main />
                    <Header />
                    <Footer />
                </div>
            </div>
        </div>
    )
}
